import React from 'react'
import {Link} from 'react-router-dom'
function StaffSidebar() {
    return (
        <div className="sidebar col-1">
                        <Link to= {{
                            pathname: "/issue/allissue",
                            }
                        }><a>View Issue</a></Link>

                        <a><Link to={{
                            pathname: '/'
                         }}>Logout</Link></a>

        </div>
    )
}

export default StaffSidebar
